var healthcheck_001_fix$1 = "Si no ests conectado a una red, debes verificar los cables, en caso de que sea por cable; si en cambio es inalmbrica, debes comprobar tu rter inalmbrico. En Windows, puedes hacer clic en el icono de red y ejecutar la opcin <i>Solucionar problemas</i>. En Mac, puedes ejecutar <i>la herramienta de diagnstico inalmbrico</i>, disponible a travs de Spotlight Search. En algunos casos, un reinicio del porttil puede solucionar la situacin.";
var healthcheck_001_tech$1 = "La verificacin enumera los adaptadores de red disponibles para encontrar una interfaz con una direccin IPv4 vlida.";
var healthcheck_002_B$1 = "La direccin IP del dispositivo se asigna en modo esttico, no por DHCP";
var healthcheck_002_G$1 = "La direccin IP del dispositivo se asigna en modo esttico";
var healthcheck_002_easy$1 = "Tu rter no asigna la direccin (IP) de tu ordenador dentro de la red, sino que se configura manualmente. Debes evitarlo a menos que comprendas el funcionamiento de las redes.";
var healthcheck_002_tech$1 = "La verificacin emite una alerta si la direccin IP del dispositivo se asigna en modo esttico y no se obtiene a travs del DHCP.";
var healthcheck_003_B$1 = "El dispositivo no est en red: intentando obtener una direccin IP del DHCP";
var healthcheck_003_G$1 = "El dispositivo est en red: se ha obtenido correctamente una direccin IP del DHCP";
var healthcheck_003_easy$1 = "Necesitas una direccin IP para que tu ordenador est en red y que as se pueda comunicar con otros dispositivos y acceder a Internet. En las redes locales actuales, wifi y Ethernet, las direcciones IP se asignan automticamente a cada PC/dispositivo a medida que se unen a la red, sin necesidad de ninguna configuracin manual previa. El proceso y servicio es el <b>DHCP</b>: Protocolo de configuracin dinmica de host.";
var healthcheck_003_fix$1 = "Si tu dispositivo no obtiene una direccin, no puedes acceder a la red. Debes intentar desconectarte y volver a conectarte a la red. Si el problema persiste, debes intentar reiniciar tu dispositivo. Si sigue sin solucionarse, puede que tu DHCP necesite un reinicio: puedes apagar y encender el rter de tu hogar para asegurarte de que se reinicia por completo.";
var healthcheck_003_tech$1 = "La verificacin garantiza que tu direccin IP actual est asignada por un DHCP y no de forma manual.";
