var healthcheck_005_B$1 = "No hay ningn servidor DNS configurado";
var healthcheck_005_G$1 = "El servidor DNS est configurado";
var healthcheck_005_easy$1 = "DNS significa Sistema de nombres de dominio: en esencia, el DNS es una base de datos que vincula nombres significativos (nombres de host), como <i>www.fing.com</i>, a direcciones IP especficas a las que se puede acceder a travs de Internet o mediante redes locales. Tu PC debe tener al menos un DNS configurado para que pueda acceder y navegar por Internet.";
var healthcheck_005_fix$1 = "En una red segura y slida, el rter enva automticamente los servidores DNS al PC. Debes comprobar la configuracin de red de tu ordenador para asegurarte de que sea correcta. Tambin puedes verificar la configuracin de tu rter para asegurarte de que tenga un DNS vlido. A veces, los servidores DNS locales o del proveedor no funcionan correctamente y puedes omitirlos configurando manualmente en tu PC local servidores DNS estndar habituales como, p. ej., Google DNS: 8.8.8.8<br/>. Si ests intentando acceder a una <b>red wifi pblica</b> que requiere un inicio de sesin, puede suceder que la pgina de inicio de sesin no aparezca y que no puedas acceder a Internet. Una buena solucin es abrir el navegador y visitar manualmente la siguiente pgina, lo que obliga a que aparezca la llamada pantalla cautiva y que te permita iniciar sesin: <b>captive.apple.com</b> ";
var healthcheck_005_tech$1 = "La comprobacin verifica que uno o ms servidores DNS estn configurados en tu PC.";
