var healthcheck_006_fix$1 = "Las posibles causas para que una pasarela no est configurada pueden ser muy diversas, por lo que no existe una solucin especfica para este problema. Debes abordar otros problemas indicados por otras comprobaciones y probar las soluciones que se sugieren.";
