var healthcheck_007_B$1 = "La conexin wifi no es fiable";
var healthcheck_007_G$1 = "La conexin wifi es buena o aceptable";
var healthcheck_007_easy$1 = "La intensidad de la seal inalmbrica se mide en dBm (decibelios-milivatios), y de manera algo confusa, se expresa como valores negativos, por eso Fing lo traduce a un valor porcentual en una escala del 1 al 100 %. Si recibes una advertencia de seal dbil, significa que tu PC, en el lugar concreto donde se encuentra, no est recibiendo una seal inalmbrica ptima, y eso afecta tanto el acceso a la red local como a la navegacin por Internet.";
var healthcheck_007_fix$1 = "En primer lugar, asegrate de que tu rter u otros puntos de acceso inalmbricos estn ubicados en alto con una lnea de visin despejada hacia las partes ms amplias de tu hogar; no escondas tu punto de acceso detrs del televisor o dentro de un armario: libralo tanto como sea posible. Otra posible causa de una mala seal son los conflictos de los canales wifi: si t y un vecino estis usando el mismo canal de red, las seales pueden interferirse entre s y ralentizar la conexin. Puedes escanear el espectro en busca de actividad en cada canal, y si ves que tu red y otra distinta estn en el mismo canal, intenta cambiar tu rter a un canal diferente: inicia sesin en el panel de control del rter, busca la configuracin inalmbrica y modifica las propiedades del canal cambiando el canal seleccionado o configurndolo en seleccin automtica de canal, si esta opcin est disponible.";
var healthcheck_007_tech$1 = "La verificacin alerta cuando la intensidad de la seal wifi est por debajo de los umbrales recomendados: la seal por encima de -60 dBm (66 %) es buena, hasta -75 dBm (40 %) no es fuerte pero s aceptable, ms all de -75 dBm no es fiable.";
var healthcheck_008_B$1 = "La velocidad del enlace de Ethernet no es ptima";
var healthcheck_008_G$1 = "La velocidad del enlace de Ethernet es rpida";
