var healthcheck_008_fix$1 = "La tarjeta de red de un PC moderno admite 1 Gbps, por lo que, en primer lugar, debes verificar los cables y asegurarte de que sean <i>cables de Ethernet Gigabit</i>. Tambin debes comprobar el rter y los interruptores opcionales en posicin intermedia, para asegurarte de que el cable est conectado al puerto Gigabit.";
var healthcheck_008_tech$1 = "La comprobacin alerta cuando la velocidad del enlace por cable es inferior a 1 Gbps.";
