var healthcheck_v_geoloc_tech$1 = "Tu direccin de Internet se busca en una base de datos de direcciones de Internet para determinar su ubicacin geogrfica y el proveedor de servicios de Internet.";
var healthcheck_v_isp_I$1 = "Informacin sobre el proveedor de servicios de Internet (PSI)";
var healthcheck_v_isp_easy$1 = "El PSI (proveedor de servicios de Internet) es una empresa que proporciona a las personas y otras empresas acceso a Internet y otros servicios relacionados, como la creacin de sitios web y el alojamiento virtual. Un PSI tiene los equipos y el acceso a las lneas de telecomunicaciones necesarios para tener un punto de presencia en Internet dentro del rea geogrfica que sirve. Los mayores PSI tienen alquiladas sus propias lneas de alta velocidad, de manera que sean menos dependientes de los proveedores de telecomunicaciones y puedan brindar un mejor servicio a sus clientes.<br/> Fing proporciona estadsticas sobre el PSI en la ubicacin actual, como cuota de mercado y velocidades medias de subida y bajada.";
var healthcheck_v_isp_tech$1 = "La informacin sobre el PSI actual se recopila mediante una bsqueda GeoIP de tu direccin de Internet. Fing Internet proporciona estadsticas e informacin sobre el SIP en la ubicacin actual.";
var healthcheck_v_network_I$1 = "Informacin sobre la red conectada";
var healthcheck_v_network_easy$1 = "Se recopila y muestra informacin detallada sobre tu red actualmente conectada. El rango de direcciones de red muestra el rango disponible de direcciones que los dispositivos pueden usar para acceder a la red y comunicarse entre s. El tipo de red te indica si la red es por cable (ethernet), inalmbrica o ambas.<br/><b> Ethernet:</b> es un protocolo de comunicacin de datos estndar que permite a los ordenadores y los dispositivos perifricos, como los porttiles, interactuar entre s y a travs de redes para el intercambio de informacin.<br/><b> Velocidad de enlace:</b> es la velocidad nominal de la conexin, medida en Mbps (megabits por segundo). Cuanto mayor sea el valor, ms rpida y mejor ser la conexin. En las redes por cable modernas, debes tener 1 Gbps (igual a 1000 Mbps), mientras que las buenas conexiones inalmbricas pueden alcanzar hasta 200-300 Mbps.<br/><b> Punto de acceso inalmbrico (PA):</b> una estacin base inalmbrica que conecta una red por cable (como la conexin Ethernet por cable en un mdem de banda ancha) a la red inalmbrica. El PA contiene un transmisor-receptor de radio (que transmite y recibe seales de radio en canales especficos). La mayora de los PA contienen tambin un componente tipo rter, que dirige los datos de tus dispositivos en red hacia y desde Internet.<br/><b> Banda/espectro inalmbrico:</b> los puntos de acceso inalmbricos usan una de las dos bandas de frecuencia wifi para la seal: 2,4 GHz o 5 GHz. Algunos son rteres de doble banda y de malla, que pueden seleccionar y mezclar automticamente canales y bandas para brindarte el mejor rendimiento.<br/><b> Canal inalmbrico:</b> dentro de las bandas de frecuencia inalmbrica hay bandas ms pequeas que se conocen como canales wifi. Un canal wifi es el medio a travs del cual nuestros dispositivos inalmbricos pueden enviar y recibir datos.<br/><b> Identificadores de conjuntos de servicios bsicos (BSSID):</b> un identificador nico para cada punto de acceso inalmbrico fsico.";
var healthcheck_v_network_tech$1 = "La comprobacin informativa proporciona detalles sobre tu red activa: el contexto que le has asignado, su rango de direcciones IP, el tipo (por cableado o inalmbrica) y lista de BSSID (si es inalmbrica).";
var healthcheck_v_nicinfo_I$1 = "Tu conexin a la red";
var healthcheck_v_nicinfo_easy$1 = "Se recopila informacin detallada acerca de tu conexin actual a la red.<br/><b> Ethernet:</b> es un protocolo de comunicacin de datos estndar que permite a los ordenadores y los dispositivos perifricos, como los porttiles, interactuar entre s y a travs de redes para el intercambio de informacin.<br/><b> Velocidad de enlace:</b> es la velocidad nominal de la conexin, medida en Mbps (megabits por segundo). Cuanto mayor sea el valor, ms rpida y mejor ser la conexin. En las redes por cable modernas, debes tener 1 Gbps (igual a 1000 Mbps), mientras que las buenas conexiones inalmbricas pueden alcanzar hasta 200-300 Mbps.<br/><b> Punto de acceso inalmbrico (PA):</b> una estacin base inalmbrica que conecta una red por cable (como la conexin Ethernet por cable en un mdem de banda ancha) a la red inalmbrica. El PA contiene un transmisor-receptor de radio (que transmite y recibe seales de radio en canales especficos). La mayora de los PA contienen tambin un componente tipo rter, que dirige los datos de tus dispositivos en red hacia y desde Internet.<br/><b> Banda/espectro inalmbrico:</b> los puntos de acceso inalmbricos usan una de las dos bandas de frecuencia wifi para la seal: 2,4 GHz o 5 GHz. Algunos son rteres de doble banda y de malla, que pueden seleccionar y mezclar automticamente canales y bandas para brindarte el mejor rendimiento.<br/><b> Canal inalmbrico:</b> dentro de las bandas de frecuencia inalmbrica hay bandas ms pequeas que se conocen como canales wifi. Un canal wifi es el medio a travs del cual nuestros dispositivos inalmbricos pueden enviar y recibir datos.<br/><b> Identificadores de conjuntos de servicios bsicos (BSSID):</b> un identificador nico para cada punto de acceso inalmbrico fsico.";
var healthcheck_v_nicinfo_tech$1 = "La comprobacin informativa proporciona detalles sobre tu conexin activa a la red: direccin IP, velocidad de enlace nominal y tipo: ethernet o inalmbrica; en las conexiones wifi, informacin sobre el nombre del punto de acceso, los BSSID, el espectro y el canal actual.";
