var healthcheck_001_easy = " necessario un indirizzo (IP) affinch il computer si trovi in una rete. Il tuo computer / dispositivo deve essere in una rete per comunicare con altri dispositivi e raggiungere Internet.";
var healthcheck_001_fix = "Se non stai entrando in rete dovresti controllare i cavi, nel caso siano cablati; se invece  Wireless dovresti controllare il tuo router Wireless. Su Windows puoi fare clic sull'icona Rete ed eseguire l'opzione <i> Risoluzione dei problemi </i>. Su Mac puoi eseguire lo strumento <i> Diagnostica wireless </i>, disponibile tramite Spotlight Search. In alcuni casi anche un riavvio del laptop pu risolvere la situazione.";
