var healthcheck_002_G = "L'indirizzo IP del dispositivo viene assegnato statico";
var healthcheck_002_easy = "Il tuo indirizzo (IP) per il tuo computer nella tua rete non  assegnato dal tuo router, ma  invece configurato manualmente. Dovresti evitarlo a meno che tu non comprenda il networking.";
var healthcheck_002_tech = "Il controllo avvisa quando l'indirizzo IP del dispositivo  assegnato staticamente e non  stato ottenuto dal DHCP.";
var healthcheck_003_B = "Il dispositivo non  in rete: tentativo di ottenere un indirizzo IP da DHCP";
var healthcheck_003_G = "Il dispositivo  in rete:  stato ottenuto correttamente un indirizzo IP dal DHCP";
var healthcheck_003_easy = " necessario un indirizzo IP affinch il computer si trovi in una rete e quindi sia in grado di comunicare con altri dispositivi e raggiungere Internet. Nelle reti locali odierne, Wi-Fi ed Ethernet, gli indirizzi IP vengono assegnati a ciascun PC / dispositivo quando si collega automaticamente alla rete, senza alcuna preconfigurazione manuale. Il processo e il servizio sono <b> DHCP </b>: Dynamic Host Configuration Protocol.";
var healthcheck_003_fix = "Se il tuo dispositivo non riceve un indirizzo, non puoi accedere alla rete. Dovresti provare a disconnetterti e riconnetterti alla rete. Se il problema persiste, dovresti provare a riavviare il dispositivo. Se il problema persiste, il tuo DHCP potrebbe aver bisogno di un riavvio: potresti spegnere e riaccendere il router di casa, per assicurarti che si avvii da zero.";
var healthcheck_003_tech = "Il controllo garantisce che il tuo indirizzo IP corrente sia assegnato da un DHCP e non sia manuale.";
var healthcheck_004_B = "L'orologio del computer non  sincronizzato";
var healthcheck_004_G = "L'orologio del computer  sincronizzato";
var healthcheck_004_easy = "Se l'orologio del computer non  sincronizzato, potrebbe influire su diverse funzionalit del PC. Anche la navigazione sul sito web pu essere influenzata poich i certificati di sicurezza sono sempre convalidati rispetto alla data di scadenza.";
var healthcheck_004_fix = "Dovresti aprire le preferenze Data e ora nelle impostazioni di sistema e assicurarti che <i> Imposta data e ora automaticamente </i> sia abilitato.";
var healthcheck_004_tech = "Il controllo confronta l'ora locale del PC con un time server remoto.";
var healthcheck_005_B = "Nessun server DNS  configurato";
var healthcheck_005_G = "Il DNS server  configurato";
var healthcheck_005_easy = "DNS sta per Domain Name Resolution: in sostanza DNS  un database che collega nomi di dominio (nomi host), come <i> www.fing.com </i>, a indirizzi IP specifici che possono essere raggiunti su Internet o in locale reti. Il tuo PC deve avere almeno un DNS configurato per poter raggiungere e navigare in Internet.";
var healthcheck_005_fix = "In una rete integra i server DNS vengono automaticamente inviati al PC dal router. Dovresti controllare la configurazione di rete del tuo computer per assicurarti che sia OK. Puoi anche controllare la configurazione del tuo router per assicurarti che abbia un DNS valido. A volte i server DNS locali o del provider non funzionano correttamente e puoi aggirarli configurando manualmente i server DNS standard comuni del PC locale come ad es. Google DNS: 8.8.8.8 <br/> Se stai accedendo a un <b> Wi-Fi pubblico </b> che necessita di login, potrebbe accadere che la pagina di login non venga visualizzata e non riesci ad accedere a Internet. Una buona soluzione  aprire il browser e visitare manualmente la pagina seguente, che forza la visualizzazione della cosiddetta schermata captive e ti consente di accedere: <b> captive.apple.com </b>";
var healthcheck_005_tech = "Il controllo verifica che uno o pi server DNS siano configurati nel PC.";
