var healthcheck_006_fix = "Se il gateway non  configurato, le possibili cause potrebbero essere molto diffuse, quindi non esiste una soluzione specifica per questo problema.  necessario risolvere altri problemi segnalati da altri controlli e provare le soluzioni suggerite.";
var healthcheck_006_tech = "Il controllo verifica che un percorso predefinito per Internet sia disponibile sull'interfaccia di rete abilitata, tramite un next hop locale che sar il gateway per Internet.";
var healthcheck_007_B = "La potenza del Wi-Fi non  affidabile";
var healthcheck_007_G = "La potenza del Wi-Fi  buona o accettabile";
var healthcheck_007_easy = "L'intensit del segnale wireless  misurata in dBm (decibel milliwatt) ed , in qualche modo confusa, espressa come valori negativi, ecco perch Fing la traduce in un valore percentuale in una scala 1-100%. Se ricevi un segnale di avviso debole, significa che il tuo PC nel punto particolare in cui ti trovi non sta ricevendo un segnale wireless ottimale e questo influisce sia sull'accesso alla rete locale che sulla navigazione in Internet.";
var healthcheck_007_fix = "Prima di tutto assicurati che il tuo router o altri punti di accesso wireless siano posizionati in alto con una visuale libera verso le parti pi ampie possibile della tua casa; non nascondere il tuo punto di accesso dietro la TV o all'interno di un mobile: liberalo il pi possibile. Un'altra possibile causa di scarso segnale sono i conflitti tra i canali Wi-Fi: se tu e un vicino state utilizzando entrambi lo stesso canale di rete, i segnali possono interferire tra loro e rallentare la connessione. Puoi eseguire la scansione dello spettro per l'attivit su ciascun canale e se noti che la tua rete e un'altra rete sono sullo stesso canale, prova a cambiare il tuo router su un canale diverso: accedi al pannello di amministrazione del router, trova la configurazione wireless e modifica le propriet del canale cambiare il canale selezionato o impostarlo sulla selezione automatica del canale, se disponibile.";
var healthcheck_007_tech = "Il controllo avvisa quando la potenza del segnale Wi-Fi  inferiore alle soglie: il segnale superiore a -60 dBm (66%)  buono, fino a -75 dBm (40%) non  forte ma accettabile, oltre -75 dBm  inaffidabile.";
var healthcheck_008_B = "La velocit del collegamento Ethernet non  ottimale";
var healthcheck_008_G = "La velocit del collegamento Ethernet  elevata";
var healthcheck_008_easy = "La velocit del collegamento alla rete cablata  misurata in Mbps (Megabit al secondo). Un valore pi alto  pi veloce, migliore. Nelle reti moderne dovresti puntare a 1 Gbps (pari a 1000 Mbps) o anche di pi nelle reti aziendali.";
var healthcheck_008_fix = "La scheda di rete del PC moderno supporta 1 Gbps, quindi prima di tutto dovresti controllare i cavi e assicurarti che siano <i> Cavo Gigabit Ethernet </i>. Dovresti anche controllare il router e gli interruttori opzionali al centro, per assicurarti che il cavo sia collegato alla porta Gigabit.";
