var healthcheck_402_fix = "Di 'a Fing se la rete attuale  una rete domestica o piuttosto una rete aziendale o pubblica. Ci far scomparire l'avviso e abiliter anche controlli di integrit della connettivit contestuale specifici sulla rete.";
