var healthcheck_403_easy = "DNS sta per Domain Name Resolution: in sostanza DNS  un database che collega nomi di dominio (nomi host), come <i> www.fing.com </i>, a indirizzi IP specifici che possono essere raggiunti su Internet o in reti locali. Il tuo PC deve avere almeno un DNS configurato per poter raggiungere e navigare in Internet.";
var healthcheck_403_fix = "In una rete integra i server DNS vengono automaticamente inviati al tuo PC dal tuo router e il tuo PC  in grado di raggiungerli tramite un percorso valido. Dovresti controllare la configurazione della tua rete locale per assicurarti che sia OK. Puoi anche controllare la configurazione del tuo router per assicurarti che abbia un DNS valido. A volte i server DNS locali o del provider non funzionano correttamente e puoi aggirarli configurando manualmente i server DNS standard comuni del PC locale come ad es. Google DNS: 8.8.8.8";
var healthcheck_403_tech = "Il controllo verifica che il server DNS primario configurato sia raggiungibile tramite un percorso valido.";
var healthcheck_404_B = "Nessun percorso al server DNS secondario";
var healthcheck_404_G = "Esiste un percorso valido per il DNS secondario";
var healthcheck_404_easy = "DNS sta per Domain Name Resolution: in sostanza DNS  un database che collega nomi di dominio (nomi host), come <i> www.fing.com </i>, a indirizzi IP specifici che possono essere raggiunti su Internet o in reti locali. Il tuo PC deve avere almeno un DNS configurato per poter raggiungere e navigare in Internet. Opzionalmente potrebbe essere configurato un DNS aggiuntivo, chiamato DNS secondario: quando il DNS primario fallisce, il PC riprova sul DNS secondario.";
var healthcheck_404_fix = "In una rete integra i server DNS vengono automaticamente inviati al tuo PC dal tuo router e il tuo PC  in grado di raggiungerli tramite un percorso valido. Dovresti controllare la configurazione della tua rete locale per assicurarti che sia OK. Puoi anche controllare la configurazione del tuo router per assicurarti che abbia un DNS valido. A volte i server DNS locali o del provider non funzionano correttamente e puoi aggirarli configurando manualmente i server DNS standard comuni del PC locale come ad es. Google DNS: 8.8.8.8";
var healthcheck_404_tech = "Il controllo verifica che i server DNS secondari configurati siano raggiungibili tramite un percorso valido.";
var healthcheck_405_B = "Nessun percorso al gateway di rete";
var healthcheck_405_G = "Esiste un percorso valido per il gateway di rete";
var healthcheck_405_easy = "Router e gateway sono dispositivi fisici che uniscono pi reti cablate o wireless insieme per consentire l'intercomunicazione: anche in una piccola rete domestica  necessario almeno un router per connettersi a Internet. Fing ti avverte nel caso in cui l'attuale configurazione di rete del PC non sia corretta per raggiungere e parlare con il gateway di rete o il router.";
var healthcheck_405_tech = "Il controllo verifica che il gateway di rete (ovvero il prossimo hop del percorso predefinito) sia raggiungibile tramite un percorso valido (locale o remoto).";
var healthcheck_406_B = "La netmask di rete (lunghezza del prefisso) non  regolata correttamente";
var healthcheck_406_G = "La netmask di rete (lunghezza del prefisso)  configurata correttamente";
var healthcheck_406_easy = "Una subnet mask  un numero che definisce l'intervallo di indirizzi (IP) disponibili all'interno di una rete. Utilizza lo stesso formato dell'indirizzo IP, ma in formato negativo, ad es. 255.255.255.0  una tipica maschera di <i> Classe C </i> che include un intervallo di 256 indirizzi. Una forma alternativa per esprimerlo  come lunghezza del prefisso di rete, che significa quanti bit dell'indirizzo di rete sono stabili: una rete di classe C  / 24, il che significa che 24 bit, i primi 3 byte dell'indirizzo, non variano.";
var healthcheck_406_fix = "Una rete troppo grande  molto pi lenta di una di giuste dimensioni. Per esempio, una rete domestica con dozzine di dispositivi non di Classe C sicuramente non sar sintonizzata correttamente. Per risolvere il problema non  necessario modificare la configurazione del PC locale, ma basta accedere alla configurazione del router e modificarla. Per assicurarti che ogni dispositivo riceva la nuova configurazione aggiornata, dovresti anche spegnere e riaccendere il router o ricollegare tutti i dispositivi collegati.";
var healthcheck_406_tech = "Il controllo verifica che la subnet mask di rete (o la lunghezza del prefisso di rete) non sia sovradimensionata. Sebbene gli standard di rete raccomandino di preferire sempre il multicast e la trasmissione durante la ricerca di dispositivi e servizi di rete, molti dispositivi IoT moderni utilizzano ancora gli sweep unicast per trovare i peer: ci significa che la ricerca, l'onboarding, l'accoppiamento o l'utilizzo del servizio quando si dispone di una grande rete lo faranno fare in modo che il dispositivo cerchi il servizio su un numero molto elevato di dispositivi possibili, anzich solo 256/512. Un buon esempio di questo  anche il gruppo di lavoro Windows: NetBIOS  unicast, quindi la ricerca di altri PC e stampanti in una grande rete richiede molto pi tempo. Lo stesso accade anche per i software di monitoraggio della rete come Fing, Fingbox e cos via: queste app sfruttano ARP-sweep o ping o simili, quindi il tempo impiegato da una scoperta di rete  proporzionale alla dimensione della rete.";
var healthcheck_407_B = "Il gateway di rete non  raggiungibile";
var healthcheck_407_G = "Il gateway di rete  raggiungibile";
var healthcheck_407_easy = "Router e gateway sono dispositivi fisici che uniscono pi reti cablate o wireless insieme per consentire l'intercomunicazione: anche in una piccola rete domestica  necessario almeno un router per connettersi a Internet. Fing ti avvisa nel caso in cui il gateway o il router non sia attualmente raggiungibile, influendo cos sull'accesso a Internet.";
var healthcheck_407_fix = "Se il gateway non  raggiungibile, non puoi accedere a Internet. Dovresti controllare i cavi, nel caso si tratti di una connessione cablata; se invece  Wireless dovresti controllare il tuo router Wireless. Su Windows puoi fare clic sull'icona Rete ed eseguire l'opzione <i> Risoluzione dei problemi </i>. Se il problema persiste, dovresti controllare se il router  acceso e funzionante, ad es. controllando se i suoi LED sono tutti verdi.";
var healthcheck_407_tech = "Il controllo verifica che il gateway di rete sia raggiungibile e attivo, ovvero rispondendo alle richieste ARP.";
var healthcheck_408_B = "Impossibile raggiungere il DNS locale";
var healthcheck_408_G = "Il DNS locale  raggiungibile";
var healthcheck_408_easy = "DNS sta per Domain Name Resolution: in sostanza DNS  un database che collega nomi di dominio (nomi host), come <i> www.fing.com </i>, a indirizzi IP specifici che possono essere raggiunti su Internet o in reti locali. Fing ti avverte nel caso in cui la tua rete abbia un server DNS locale configurato per rispondere alle domande, ma sembra che non stia rispondendo correttamente alle richieste.";
var healthcheck_408_fix = "Dovresti controllare la configurazione del tuo router per assicurarti che abbia un set DNS valido e se  esso stesso potresti pensare di spegnerlo e spegnerlo. Puoi provare a bypassare il DNS della rete locale configurando manualmente nel tuo PC locale server DNS standard comuni come ad es. Google DNS: 8.8.8.8";
var healthcheck_408_tech = "Il controllo verifica che il server DNS locale configurato sia effettivamente raggiungibile e attivo, rispondendo alle domande.";
