var healthcheck_409_tech = "Il controllo verifica che il server DNS locale secondario configurato sia effettivamente raggiungibile e attivo, rispondendo alle domande.";
var healthcheck_40A_B = "Alcuni dispositivi non sono in grado di entrare in rete";
var healthcheck_40A_G = "I dispositivi stanno entrando con successo nella rete";
var healthcheck_40A_easy = "I dispositivi necessitano di un indirizzo (IP) per essere in rete e quindi essere in grado di comunicare con altri dispositivi e raggiungere Internet. Nelle reti locali odierne, Wi-Fi ed Ethernet, gli indirizzi IP vengono assegnati a ciascun PC / dispositivo quando si collega automaticamente alla rete, senza alcuna preconfigurazione manuale. Il processo e il servizio sono <b> DHCP </b>: Dynamic Host Configuration Protocol.";
var healthcheck_40A_fix = "Il primo controllo dovrebbe essere sul dispositivo di destinazione che sta riscontrando problemi nell'accesso alla rete: controlla la configurazione di rete (nome di rete, password, ecc.) del tuo Wi-Fi e assicurati che sia corretta. Un ciclo di accensione e spegnimento del dispositivo specifico pu essere di aiuto in alcuni casi, poich all'avvio tenter di nuovo di entrare in rete. In alcune situazioni potrebbe accadere che il tuo router / DHCP abbia esaurito gli indirizzi da assegnare a nuovi dispositivi. Quindi, come ultima risorsa, puoi spegnere e riaccendere il router: si riavvier assegnando gli indirizzi ai dispositivi; tieni presente che il riavvio del router causer un'interruzione temporanea di qualsiasi rete per tutti i dispositivi.";
var healthcheck_40A_tech = "Il controllo monitora le richieste DHCP di altri dispositivi che entrano nella rete: viene generato un avviso se alcuni dispositivi inviano pi richieste ma non ottengono alcun indirizzo valido per rimanere nella rete locale.";
