var healthcheck_415_fix = "Nel caso in cui non sia attivo alcun DHCP, potrebbe essere che il router / DHCP abbia esaurito gli indirizzi da assegnare ai nuovi dispositivi; come ultima risorsa, puoi controllare lo stato del router provando a spegnerlo e riaccenderlo: si riavvier assegnando gli indirizzi ai dispositivi; tieni presente che il riavvio del router causer un'interruzione temporanea di qualsiasi rete per tutti i dispositivi. <br/> Nel caso in cui invece i controlli riportino pi di un DHCP in esecuzione nella rete, assicurati di disattivare i DHCP finch non ne rimane uno solo. Dovresti cercare i DHCP in esecuzione in altri router, switch e dispositivi di sicurezza.";
var healthcheck_415_tech = "Il controllo verifica che un singolo server DHCP sia attivo: viene generato un avviso se non  presente alcun DHCP o quando  presente pi di un server DHCP che offre indirizzi IP.";
