var healthcheck_v_gateway_I = "Informazioni sul router o sul gateway";
var healthcheck_v_gateway_easy = "Router e gateway sono dispositivi fisici che uniscono pi reti cablate o wireless insieme per consentire l'intercomunicazione: anche in una piccola rete domestica  necessario almeno un router per connettersi a Internet. Fing ti fornisce dettagli rilevanti sul tuo router o gateway, utili per conoscerne il tipo, la marca, il modello e la versione specifici.";
var healthcheck_v_gateway_tech = "Il controllo informativo fornisce dettagli sul gateway di rete.";
var healthcheck_v_geoloc_I = "Informazioni di geolocalizzazione sul tuo indirizzo Internet";
var healthcheck_v_geoloc_easy = "Una forma di geolocalizzazione: GeoIP si riferisce al metodo di localizzazione della posizione geografica di un dispositivo identificando quell'indirizzo Internet ed eseguendo una ricerca remota nel database nei nostri server per individuare il paese, la regione, la citt e il provider di servizi Internet.";
var healthcheck_v_geoloc_tech = "Il tuo indirizzo Internet viene cercato in un database di indirizzi Internet per determinarne la posizione geografica e il provider di servizi Internet.";
var healthcheck_v_isp_I = "Informazioni riguardo l'Internet Service Provider (ISP)";
var healthcheck_v_isp_easy = "ISP (Internet Service Provider)  una societ che fornisce a privati e altre societ l'accesso a Internet e ad altri servizi correlati come la creazione di siti Web e l'hosting virtuale. Un ISP dispone delle apparecchiature e dell'accesso alla linea di telecomunicazione necessari per avere un punto di presenza su Internet per l'area geografica servita. Gli ISP pi grandi hanno le proprie linee affittate ad alta velocit in modo che siano meno dipendenti dai fornitori di telecomunicazioni e possano fornire un servizio migliore ai propri clienti. <br/> Fing fornisce statistiche sull'ISP nella posizione corrente, come quota di mercato, download medio e velocit di caricamento.";
var healthcheck_v_isp_tech = "Le informazioni sull'ISP corrente vengono raccolte da una ricerca GeoIP del tuo indirizzo Internet. Fing Internet fornisce statistiche e approfondimenti sull'ISP nella posizione corrente.";
var healthcheck_v_network_I = "Informazioni sulla rete connessa ";
var healthcheck_v_network_easy = "Vengono raccolte e visualizzate informazioni dettagliate sulla rete attualmente connessa. L'intervallo di indirizzi di rete mostra l'intervallo di indirizzi disponibile che i dispositivi possono utilizzare per accedere alla rete e comunicare tra loro. Il tipo di rete indica se la rete  cablata (ethernet) o wireless o entrambe. <br/> <b> Ethernet: </b> un protocollo di comunicazione dati standard che consente a computer e periferiche, come i laptop, di interfacciarsi con uno un altro e attraverso le reti per lo scambio di informazioni. <br/> <b> Velocit di collegamento: </b>  la velocit nominale della connessione, misurata in Mbps (Megabit al secondo). Un valore pi alto  pi veloce, migliore. Nelle moderne reti cablate dovresti mirare a 1 Gbps (pari a 1000 Mbps), mentre buone connessioni wireless possono raggiungere fino a 200-300 Mbps. <br/> <b> Punto di accesso wireless (AP): </b> Una stazione base wireless che collega una rete cablata (come la connessione Ethernet cablata su un modem a banda larga) alla rete wireless. L'AP contiene un ricetrasmettitore radio (che trasmette e riceve segnali radio su canali specifici). La maggior parte degli AP contiene anche un componente router, che indirizza i dati dei dispositivi in rete da e verso Internet. <br/> <b> Banda / spettro wireless: </b> i punti di accesso wireless utilizzano una delle due bande di frequenza Wi-Fi per il segnale: 2,4 GHz o 5 GHz. Alcuni sono router dual-band e router mesh sono in grado di selezionare e mixare automaticamente canali e bande per offrirti le migliori prestazioni. <br/> <b> Canale wireless: </b> all'interno delle bande di frequenza wireless ci sono bande pi piccole che sono indicati come canali Wi-Fi. Un canale Wi-Fi  il mezzo attraverso il quale i nostri dispositivi wireless possono inviare e ricevere dati. <br/> <b> Basic Service Set Identifier (BSSID): </b> un identificatore univoco per ogni punto di accesso wireless fisico.";
var healthcheck_v_network_tech = "Il controllo informativo fornisce dettagli sulla tua rete attiva: il contesto che hai assegnato, il suo intervallo di indirizzi IP, il tipo (cablato e / o wireless), l'elenco dei BSSID (se wireless).";
var healthcheck_v_nicinfo_I = "La tua connessione alla rete";
var healthcheck_v_nicinfo_easy = "Vengono raccolte informazioni dettagliate sulla connessione corrente alla rete. <br/> <b> Ethernet: </b> un protocollo di comunicazione dati standard che consente a computer e periferiche di computer, come i laptop, di interfacciarsi tra loro e attraverso le reti per lo scambio di informazioni. <br/> <b> Velocit di collegamento: </b>  la velocit nominale della connessione, misurata in Mbps (Megabit al secondo). Un valore pi alto  pi veloce, migliore. Nelle moderne reti cablate dovresti mirare a 1 Gbps (pari a 1000 Mbps), mentre buone connessioni wireless possono raggiungere fino a 200-300 Mbps. <br/> <b> Punto di accesso wireless (AP): </b> Una stazione base wireless che collega una rete cablata (come la connessione Ethernet cablata su un modem a banda larga) alla rete wireless. L'AP contiene un ricetrasmettitore radio (che trasmette e riceve segnali radio su canali specifici). La maggior parte degli AP contiene anche un componente router, che indirizza i dati dei dispositivi in rete da e verso Internet. <br/> <b> Banda / spettro wireless: </b> i punti di accesso wireless utilizzano una delle due bande di frequenza Wi-Fi per il segnale: 2,4 GHz o 5 GHz. Alcuni sono router dual-band e router mesh sono in grado di selezionare e mixare automaticamente canali e bande per offrirti le migliori prestazioni. <br/> <b> Canale wireless: </b> all'interno delle bande di frequenza wireless ci sono bande pi piccole che sono indicati come canali Wi-Fi. Un canale Wi-Fi  il mezzo attraverso il quale i nostri dispositivi wireless possono inviare e ricevere dati. <br/> <b> Basic Service Set Identifier (BSSID): </b> un identificatore univoco per ogni punto di accesso wireless fisico.";
var healthcheck_v_nicinfo_tech = "Il controllo informativo fornisce dettagli sulla connessione attiva alla rete: indirizzo IP, velocit di collegamento nominale, tipo: ethernet o wireless; sulle connessioni Wi-Fi informazioni su nome punto di accesso, BSSID, spettro e canale corrente.";
var healthcheck_v_self_I = "Informazioni sul tuo dispositivo";
